package collections;

import java.util.HashSet;

public class Hashset1 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println("Hashset");
		HashSet<String> hash=new HashSet<>();
		hash.add(null);
		hash.add("ramu");
		hash.add("sitha");
		hash.add("gita");
		for(String a:hash) {
			System.out.println(a);
			

	}

}}
